// (95)
// >>> fruit_distribution(("100 apples and 1 oranges"), (120))
// (19)
long fruit_distribution(std::string s, long n) {
    long apples = 0, oranges = 0, mango = 0;
    std::stringstream ss(s);
    std::string token;
    while(std::getline(ss, token, ' ')) {
        if(token == "apples") {
            apples = std::stoi(token);
        } else if(token == "oranges") {
            oranges = std::stoi(token);
        } else {
            mango = std::stoi(token);
        }
    }
    return n - apples - oranges - mango;

