// Given a positive integer N, return the total sum of its digits in binary.
// Example
// >>> solve((1000))
// ("1")
// >>> solve((150))
// ("110")
// >>> solve((147))
// ("1100")
// Variables:
// @N integer
// Constraints: 0 ≤ N ≤ 10000.
// Output:
// a string of binary number
std::string solve(long N) {
    std::string ans;
    while(N > 0) {
        ans += std::to_string(N % 2);
        N /= 2;
    }
    std::reverse(ans.begin(), ans.end());
    return ans;

