    std::vector<long> res;
    for(auto i:x) {
        bool flag = false;
        while(i) {
            if(i%10%2==0) {
                flag = true;
                break;
            }
            i/=10;
        }
        if(!flag) res.push_back(i);
    }
    std::sort(res.begin(),res.end());
    return res;

