// Given a positive integer, obtain its roman numeral equivalent as a string,
// and return it in lowercase.
// Restrictions: 1 <= num <= 1000
// Examples:
// >>> int_to_mini_roman((19))
// ("xix")
// >>> int_to_mini_roman((152))
// ("clii")
// >>> int_to_mini_roman((426))
// ("cdxxvi")
std::string int_to_mini_roman(long number) {
    std::string roman_numeral;
    std::vector<std::string> roman_numerals = {
        "m", "cm", "d", "cd", "c", "xc", "l", "xl", "x", "ix", "v", "iv", "i"
    };
    std::vector<int> decimal_values = {
        1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1
    };
    for (int i = 0; i < decimal_values.size(); ++i) {
        while (number >= decimal_values[i]) {
            roman_numeral += roman_numerals[i];
            number -= decimal_values[i];
        }
    }
    return roman_numeral;

